INSERT INTO `applicants` VALUES (2001,235,'laloyala.txt',_binary 'Hostel Management System\r\nPatient Management System\r\nOnline Examination System\r\nLibrary Management System\r\nFood Delivery application using Python\r\nCustom Messenger Application\r\nNews aggregator\r\nCalorie Counter Application\r\nImplementation Of Result Management System\r\nFeedback Information system\r\nBuilding a Fully Functional E Commerce Web Application using python\r\nOnline Employee Recruitment System\r\nImplementation of Live Weather Forecast Application using Python\r\nImplementation of Task Management System\r\n\r\n\r\nOnline Examination System\r\nEcommerce\r\nCalorie Counter Application\r\nFood Delivery\r\nFeedback Information system\r\nNews aggregator\r\nLibrary Management\r\nResult Management System\r\nMessenger\r\nOnline Employee recruitment system\r\nPMS\r\n\r\n\r\nHMS\r\nLive weather forecast\r\nTask Management System\r\nImplementation of Live Weather Forecast Application using Python\r\n\r\n','2023-03-17 16:19:52','Approved'),(101,235,'remote cloud.tx',_binary 'Eligibility:\r\nBE/B.Tech, MCA, ME/M.Tech from Any Branch\r\n\r\nSkills & Requirements:\r\n1. Has done AWS/Cloud computing course\r\n2. Must have good algorithm skills\r\n\r\nKey Responsibilities:\r\n1. Set up, monitor, and maintain DevOps cloud-based products and solutions involving ELK, big data, microservices, and cloud\r\n2. Work on AWS infrastructure management\r\n3. Make use of Docker and Kubernetes clusters supporting multi-tenant environments\r\n4. Evaluate new technology options\r\n5. Scale and improve application systems proactively to meet rapid growth\r\n6. Work closely with IT and development teams on system provisioning and configuration\r\n7. Ensure application reliability and performance\r\n8. Work closely with development teams to deliver ongoing releases and updates\r\n\r\nWork Location: Gurgaon\r\n\r\nSalary(CTC): INR 6.36 LPA\r\nProbation (6 Months): Salary during probation - INR 30,000/month\r\n\r